				&lt;p&gt;The Open Geospatial Consortium (OGC) is an international industry consortium of 
&lt;strong&gt;466&lt;/strong&gt;  
companies, government agencies and universities participating in a consensus process to develop publicly available interface standards. 
OGC® Standards support interoperable solutions that "geo-enable" the Web, wireless and location-based services and mainstream IT. The standards empower technology developers to make complex spatial information and services accessible and useful with all kinds of applications.  &lt;/p&gt;
&lt;p&gt;OGC® and OpenGIS® are registered trademarks of the Open Geospatial Consortium (OGC). OGC is the brand name associated with the standards and documents produced by the OGC. OGC standards are developed in a unique consensus process supported by the OGC's industry, government and academic members to enable geoprocessing technologies to interoperate, or "plug and play". 
You will also find the OGC trademark associated with products that implement our standards and that have obtained the Certified OGC Compliant brand. Make sure that your geoprocessing and location services procurement and technology development programs demand OGC standards!
&lt;/p&gt;

