The National Centre for Groundwater Research and Training is a Co-Funded Centre of Excellence of the Australian Research Council and the National Water Commission.&lt;br/&gt;
					&lt;br/&gt;
The Centre was established in June 2009, with Commonwealth funding of $29.5M over five years.&lt;br/&gt;
					&lt;br/&gt;
Subsequent to the award of this core funding, the Centre was awarded an additional $15M over four years to develop groundwater research infrastructure as part of the Australian Government's Super Science (Marine and Climate) initiative, funded by the Education Infrastructure Fund and administered by the Department of Innovation, Industry, Science and Research.&lt;br/&gt;
					&lt;br/&gt;
This substantial investment in groundwater by the Australian Government has created an unprecedented opportunity for groundwater researchers and the industry, making us the envy of the groundwater world.&lt;br/&gt;
